import './App.css';
import React, {useState, useEffect} from 'react';
import axios from 'axios';

const fetchData = () => 
  axios({
    method: 'GET',
    url:'https://api.publicapis.org/entries#'
  })

function App() {
  const [data, setData] = useState([])

  useEffect(() => {
    fetchData()
    .then((res) => {
      setData(res.data.entries.slice(0,10))
    })
    .catch((err) => {
      console.log(err)
    })
  }, [])

  console.log(data)

  return (
    <div>
      hello, the data are 
      {data.map((item, index) => 
        <>
          <p>API: {item.API}</p>
          <p>Category: {item.Category}</p>
        </>
    )}
    </div>
  );
}

export default App;
